import React, { useState } from "react";
import classes from './SignUp.module.css';
import { Link} from "react-router-dom";
import SignUp_Img from "../../Images/SignUp.svg";

function SignUp() {
  const [signupDetails, setsignupDetails] = useState({
    name: "",
    email: "",
    password: "",
    empcode: "",
    address: "",
    joiningdate: "",

  });
  const onChangeHandler = (e) => {
    let user = signupDetails;
    user[e.target.name] = e.target.value;
    setsignupDetails(user);
  };

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    return;        
  }
    return (
      <div className={classes.SignUp}>
      <div className={classes.SignUp_Image}>
          <img src={SignUp_Img} alt="SignUp" />
      </div>
      <div className={classes.SignIn_Box}>
            <form onSubmit={onSubmitHandler}>
              <h1 className={classes.title_SU}>SIGN IN</h1>
              <br></br>
              <input
                type="text"
                placeholder="Name"
                name="name"
                value={signupDetails.name}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="email"
                placeholder="Email"
                name="email"
                value={signupDetails.email}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="password"
                placeholder="Password"
                name="password"
                value={signupDetails.password}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="text"
                placeholder="Emp-Code"
                name="empcode"
                value={signupDetails.empcode}
                onChange={onChangeHandler}
              /><br></br>

              <input
                type="text"
                placeholder="Address"
                name="address"
                value={signupDetails.address}
                onChange={onChangeHandler}
              /><br></br>
              

              <input type="submit" value="SUBMIT" />
              <br></br>
              <div className={classes.bottomLinkWrapper}>
              <Link to="/forgot-password" className={classes.BottomLinks}>
                Forgot Password ?
              </Link>
              <br></br>
              <Link to="/signup" className={classes.BottomLinks}>
                New User ?
              </Link>
            </div>
            </form>
        </div>
    </div>
    );
  }
  
  export default SignUp;
